func constructProductMatrix(grid [][]int) [][]int {
    n, m := len(grid), len(grid[0])
    mod := 12345

    // Initialize the product matrix with ones
    p := make([][]int, n)
    for i := range p {
        p[i] = make([]int, m)
        for j := range p[i] {
            p[i][j] = 1
        }
    }

    // Calculate row and column products
    rowProducts := make([]int, n)
    colProducts := make([]int, m)
    for i := 0; i < n; i++ {
        rowProducts[i] = 1
        for j := 0; j < m; j++ {
            rowProducts[i] = (rowProducts[i] * grid[i][j]) % mod
        }
    }
    for j := 0; j < m; j++ {
        colProducts[j] = 1
        for i := 0; i < n; i++ {
            colProducts[j] = (colProducts[j] * grid[i][j]) % mod
        }
    }

    // Calculate the product matrix
    for i := 0; i < n; i++ {
        for j := 0; j < m; j++ {
            for k := 0; k < m; k++ {
                if k != j {
                    p[i][j] = (p[i][j] * grid[i][k]) % mod
                }
            }
            for l := 0; l < n; l++ {
                if l != i {
                    p[i][j] = (p[i][j] * grid[l][j]) % mod
                }
            }
        }
    }

    return p
}
